e-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Notespace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]]], \"169\" [:div nil [:div [:p/markdown \"--------------------\"]]], \"179\" [:div nil [:div [:p/markdown \"One way to generate mathematical form is to use the codegocs.com service.\"]]], \"156\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] [:div nil]], \"159\" [:div nil [:div [:p/markdown \"### Vega-lite is supported\"]]], \"162\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"(defn abcd [x] (+ x 9))\\\"]\", :bg-class \"bg-light\"}] [:div [:p/code \"(defn abcd [x] (+ x 9))\"]]], \"192\" [:div nil [:div [:p/markdown \"An example of properly annotated form with a variable that resolves to a keyword which is attached to a kind->behavior method:\"]]], \"113\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"12\\n\"}]]]], \"167\" [:div nil [:div [:p/markdown \"--------------------\"]]], \"197\" [:div [:p/code {:code \"(fact\\n (+ 1 2) => 4)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big {:style {:color \"darkred\"}} \"❌\"]] \"   false\"]]], \"107\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"115\" [:div nil [:div [:p/markdown \"#### eval-and-realize-this-notespace\\n\\nUse `notespace.api/eval-and-realize-this-notespace` to evaluate all notes in the current namespace sequentially, one note after another, and then realize them in the background. As always, Notespace is informed about the results.\"]]], \"111\" [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"12\\n\"}]]], \"172\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"176\" [:div nil [:div [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]]], \"119\" [:div nil [:div [:p/markdown \"### Listening to changes\\n\\n`(notespace.api/listen)` will tell Notespace to listen to changes in the file corresponding to the current namespace (on a file save). When changes occur, (notespace.api/eval-and-realize-notes-from-change) is called. This results in an [Oz](https://github.com/metasoarous/oz)-like live-reload experience.\\n\\n`(notespace.api/unlisten)` will tell Notespace to stop listening to the current namespace.\"]]], \"145\" [:div [:p/code {:code \"^kind/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"128\" [:div nil [:div [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"199\" [:div [:p/code {:code \"^kind/hiccup\\n(notespace/midje-summary)\", :bg-class \"bg-light\"}] [:div [:div [:div \"Tests summary:\" [:div [:big [:big {:style {:color \"darkred\"}} \"❌\"]] \": \" 1] [:div [:big [:big {:style {:color \"darkgreen\"}} \"✓\"]] \": \" 1]]]]], \"186\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"152\" [:div nil [:div [:big [:big 3]]]], \"181\" [:div nil [:div [:p/markdown \" Please check its usage condition before using it.\"]]], \"184\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"106\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"173\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] [:div [:hiccup [:big [:big 3]]]]], \"190\" [:div [:p/code {:code \"(defmethod\\n  ^{:doc\\n    \\\"Example of user extensible kind.\\nNote the ':reload true' in the :require vector:\\n[notespace.kinds :as k :reload true].\\nThis will make REPL testing your extensible kind easier!\\\"}\\n  kind/kind->behaviour ::just-code\\n  [_]\\n  {:render-src?   true\\n   :value->hiccup (constantly nil)})\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#multifn[kind->behaviour 0x46d3702a]\\n\"}]]], \"112\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]]]], \"148\" [:div nil [:div [:p/markdown \"* a\\n* b\\n* c\\n* d\"]]], \"137\" [:div nil [:div [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]]], \"140\" [:div nil [:div [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]]], \"136\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"166\" [:div [:p/code {:code \"^kind/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.3968028904888381, \"z\" \\a} {\"x\" 1, \"y\" 0.7994169658174662, \"z\" \\b} {\"x\" 2, \"y\" 0.9224532678424634, \"z\" \\c} {\"x\" 3, \"y\" 0.9513715700038389, \"z\" \\a} {\"x\" 4, \"y\" 0.7880948354539987, \"z\" \\b} {\"x\" 5, \"y\" 0.5786000517460498, \"z\" \\c} {\"x\" 6, \"y\" 0.6575302421681519, \"z\" \\a} {\"x\" 7, \"y\" 0.3556707968702433, \"z\" \\b} {\"x\" 8, \"y\" 0.7447203942134625, \"z\" \\c})}]]]], \"121\" [:div nil [:div [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` or `notespace.api/eval-and-realize-this-notespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]]], \"194\" [:div nil [:div [:p/markdown \"## Midje tests\\n\\nTests of the Midje test framework are rendered as follows:\"]]], \"168\" [:div [:p/code {:code \"^kind/dataset-grid\\n{:a [1 2 3]\\n :b [4 5 6]}\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]]], \"154\" [:div [:p/code {:code \"^kind/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (-0.13011670567448874 0.2009708389459698 0.5108313326847337 0.6605923432573652 0.4844055892490191 0.4287845932819089 0.4334427187325982 0.07045041758997383 -0.043580133173938274 -0.36354787140033784 -0.526693591060815 -0.13906718930620043 0.2640878470196568 -0.16066326342865445 -0.026824141469316998 -0.46134945812987094 -0.1782577571502001 0.10842756400927656 0.1845753707723924 -0.23432392763716736 0.22912188876549544 0.46168063659754255 0.5587249672164353 0.728918581401663 0.3987527300787279 0.26395402198163775 0.1908891862922868 0.1342072518793921 0.27966383495547775 0.6098603878673691 0.48967143511882405 0.43056980981013804 0.8024879909758462 0.446697143718383 0.9031518210998021 1.2721724903574967 0.941138279061445 1.1219827052760905 0.9699232957338733 0.5843948361472451 0.5446744013175502 0.23702629724943602 0.7000196917845091 0.5415540841059663 0.46467705743586507 0.779389975642665 0.9534485468772275 0.9118641367489969 1.1134339328057197 1.118063257117516 0.6975432270198858 0.2053175807791886 0.5615071653718778 0.20066356093701165 0.41363039525217316 0.49731229093257445 0.2448005424997448 -0.18299917683091038 0.11357295299098014 0.3200094944874766 -0.07392680652579131 -0.2871005921101356 0.0425926088084948 0.23960647720149997 0.3689573651987682 0.2772581260387659 -0.1885968016442905 0.2959347292455926 -0.14107068379154486 0.10894702448898563 0.04309203669554296 -0.003947334217897391 -0.12964509893803344 -0.3767112696448487 -0.736624267904257 -0.34920724782509716 -0.5433138072125432 -0.3944465904029001 -0.6681735029826193 -0.8524563297884982 -1.0428798322970714 -1.1138920361884754 -1.1685840762499449 -1.6110991159372545 -2.0074524848296456 -2.276397010323938 -1.8707448323694886 -1.7797972743006065 -1.9085828112087917 -2.336143842244623 -2.082275455018875 -1.6556157958887836 -1.7327782122182098 -1.782104514939927 -1.432720393382427 -1.894973145227262 -1.9113312404738876 -1.7020362559162376 -1.8049027186424527), :svgHeight 20}]]]], \"110\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] [:div nil]], \"174\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"171\" [:div nil [:div [:p/markdown \"--------------------\"]]], \"130\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:div [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"{:x 3}\\n\"}]]]], \"200\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:div [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"(-0.07836672121794297\\n -0.3373739828416882\\n -0.11397240655548058\\n -0.6137247390513304\\n -0.3445663733242901\\n -0.32173941421714747\\n -0.16305437369065412\\n -0.6219844501151832\\n -0.165910021020785)\\n\"}]]]], \"183\" [:div [:p/code {:code \"^kind/hiccup\\n(->codecogs  \\\"\\\\\\\\tfrac{2}{\\\\\\\\alpha + \\\\\\\\beta}\\\")\", :bg-class \"bg-light\"}] [:div [:img {:src \"http://latex.codecogs.com/svg.latex?\\\\tfrac{2}{\\\\alpha + \\\\beta}\"}]]], \"122\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]]]], \"149\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"120\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"144\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]]], \"134\" [:div nil [:div [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]]], \"146\" [:div [:p/code {:code \"^kind/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"177\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"125\" [:div nil [:div [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"104\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"21\\n\"}]]], \"102\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"165\" [:div nil [:div [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value which is one of the following:\\n- a map, whose values are same-length sequentials (one example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries);\\n- a sequence of maps.\\n\\nThey render that values as an [ag-Grid](https://www.ag-grid.com/) table view.\\n\\nFor example:\"]]], \"153\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"142\" [:div nil [:div [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]]], \"127\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"109\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] [:div nil]], \"124\" [:div nil [:div [:p/markdown \"### Futures\"]]], \"138\" [:div [:p/code {:code \"^kind/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((4 3 2 3 1 5)\\n (2 1 0 4 3 3)\\n (5 3 5 5 3 3)\\n (4 0 0 2 4 4)\\n (4 3 0 3 4 0)\\n (0 3 4 4 5 4))\\n\"}]]], \"114\" [:div nil [:div [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]]], \"198\" [:div nil [:div [:p/markdown \"We can ask for a tests summary:\"]]], \"133\" [:div nil [:div [:p/markdown \"### Promises\\nComing soon.\"]]], \"147\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"151\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"182\" [:div [:p/code {:code \"(defn ->codecogs [formula]\\n  [:img {:src\\n         (str \\\"http://latex.codecogs.com/svg.latex?\\\"\\n              formula)}])\", :bg-class \"bg-light\"}] [:div nil]], \"189\" [:div nil [:div [:p/markdown \"## Extending Notespace with new note kinds.\"]]], \"143\" [:div nil [:div nil]], \"178\" [:div nil [:div [:p/markdown \"## Mathematic formula\"]]], \"170\" [:div [:p/code {:code \"^kind/dataset-grid\\n[{:a 1 :b 4}\\n {:a 2 :b 5}\\n {:a 3 :b 6}]\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]]], \"131\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"103\" [:div nil [:div [:p/markdown \"## Notes\\n\\nHere is a note:\"]]], \"161\" [:div nil [:div [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]]], \"129\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div nil]], \"187\" [:div nil [:div [:p/markdown \"## Progress logging\\n\\nThis should be documented better soon.\"]]], \"164\" [:div nil [:div [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]]], \"163\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"def abcd(x):\\n  return x+9\\\"\\n {:language :python}]\", :bg-class \"bg-light\"}] [:div [:p/code \"def abcd(x):\\n  return x+9\" {:language :python}]]], \"160\" [:div [:p/code {:code \"^kind/vega\\n{\\n  :description \\\"A simple bar chart with embedded data.\\\"\\n  :data {\\n    :values [\\n      {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n      {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n      {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n    ]\\n  }\\n  :mark :bar\\n  :encoding {\\n    :x {:field :a :type :nominal :axis {:labelAngle 0}}\\n    :y {:field :b :type :quantitative}\\n  }\\n}\", :bg-class \"bg-light\"}] [:div [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]]], \"150\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"117\" [:div nil [:div [:p/markdown \"#### eval-and-realize-notes-from-line\\n\\nUse `notespace.api/eval-and-realize-notes-from-line` to evaluate and realize all notes starting from a certain line, and inform Notespace.\"]]], \"132\" [:div [:p/code {:code \"^kind/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]]}}");
